import React from 'react';
import "./Navbar.css";
import logo from "./comarca-logo-ok.png"

//BOOTSTRAP
import "bootstrap/dist/css/bootstrap.min.css";

import { Container, Navbar, Button , Nav, Row, Col } from 'react-bootstrap';

function navbar() {
    return (
        <Container>
            <Navbar fixed="top" className="navContainer">
                <Row>
                    <Col>
                        <Navbar.Brand href="index.html">
                            <img
                                src= {logo}
                                width="100"
                                height="auto"
                                className="d-inline-block align-top"
                                alt="Comarca de creadores logo"
                            />
                        </Navbar.Brand>
                    </Col>
                    <Col>

                    </Col>

                </Row>
            </Navbar>
        </Container>

    );
};

export default navbar;
